import { ReactNode } from 'react'
import Button from "react-bootstrap/Button"

interface DeletePostButtonProps {
    children: ReactNode,
}

const DeletePostButton = ({children}: DeletePostButtonProps) => {
  return (
    <Button variant="danger" title='Delete this post?'>{children}</Button>
  )
}

export default DeletePostButton
